// src/components/draggable-element.tsx
import React from 'react';
import { useDrag, DragSourceMonitor, DragSourceHookSpec } from 'react-dnd';

interface DraggableElementProps {
  type: string;
  content: React.ReactNode;
  onDragStart: () => void; // Callback for drag start event
}

interface DragItem {
  type: string;
}

const DraggableElement: React.FC<DraggableElementProps> = ({ type, content, onDragStart }) => {
  const [{ isDragging }, drag] = useDrag<DragItem, unknown, { isDragging: boolean }>({
    type: 'TOOLBOX_ITEM',
    item: { type },
    collect: (monitor: DragSourceMonitor) => ({
      isDragging: monitor.isDragging(),
    }),
  });

  return (
    <div
      ref={drag}
      style={{
        opacity: isDragging ? 0.5 : 1,
        cursor: 'move',
      }}
    >
      {content}
    </div>
  );
};

export default DraggableElement;
